(1, 1, 3, 1, 'A1_1', 1, '<b>Attendance:</b> What percentage of the total course do you estimate that you attended?', 1),
(2, 1, 3, 1, 'b_SQ001', 2, '<b>Course Structure:</b> The course aims were made clear at the start.', 1),
(3, 1, 3, 1, 'b_SQ002', 3, '<b>Course Structure:</b> Feedback has been given, either in weekly progression, in class or upon assessment.', 1),
(4, 1, 3, 1, 'b_SQ003', 4, '<b>Course Structure:</b> The course resources were available and you have successfully been able to meet your objectives over the term.', 1),
(5, 1, 3, 1, 'c_SQ001', 5, '<b>Assumed Knowledge Access:</b> Materials on the topics presented were easy to find.', 1),
(6, 1, 3, 1, 'd_SQ001', 6, '<b>Supplementary Material (where issued):</b> The hand-outs/slides/notes/reading lists were useful.', 1),
(7, 1, 3, 1, 'e_A1', 7, '<b>Teaching Delivery:</b> The teaching team (lecturers, teaching assistants) were able to explain materials.', 1),
(8, 1, 3, 1, 'e_A2', 8, '<b>Teaching Delivery:</b> You were given opportunities to catch up with work, review progression (e.g. milestones) and reflect on learning (e.g. bi-weekly reports) during the term.', 1),
(9, 1, 3, 1, 'e_A4', 9, '<b>Teaching Delivery:</b> Course content and subject matter were current and up-to date.', 1),
(10, 1, 3, 1, 'e_A5', 10, '<b>Teaching Delivery:</b> Online materials and activities were clearly structured and presented and integrated well into the course (including Moodle).', 1),
(11, 1, 3, 1, 'f_SQ001', 11, '<b>Student Participation (where applicable):</b> Student participation was encouraged during the course (e.g. debates in teams, during classtime or online on Moodle, peer/academic presentations).', 1),
(12, 1, 3, 2, 'g_SQ001', 12, '<b>Workload and Feedback:</b> The workload was fairly distributed throughout the term.', 1),
(13, 1, 3, 2, 'g_SQ002', 13, '<b>Workload and Feedback:</b> The criteria used for marking and assessment were clear.', 1),
(14, 1, 3, 2, 'g_SQ003', 14, '<b>Workload and Feedback:</b> Internal (academic) or external (client) feedback provided on my work was helpful in developing my understanding of the subject.', 1),
(15, 1, 3, 2, 'g_SQ004', 15, '<b>Workload and Feedback:</b> Feedback on my work/milestones was provided within one calendar month by a member of the teaching team (including teaching assistants).', 1),
(16, 1, 3, 2, 'g_SQ005', 16, '<b>Workload and Feedback:</b> Feedback was provided by the lead supervisors on research projects/dissertations/long essays on at least one occasion.', 1),
(17, 1, 3, 2, 'h_SQ001', 17, '<b>Interest and Rating:</b> The module interests (including theory reading, coursework, project work) of this class are important to me and my future.', 1),
(18, 1, 3, 2, 'h_SQ002', 18, '<b>Interest and Rating:</b> My overall rating of this class, its outputs and my knowledge gained once completed is positive.', 1),
(19, 1, 3, 2, 'i_sq1', 19, '<b>Teaching Support Facilities (optional where applicable):</b> The teaching team (including number of teaching assistants) and academic resources are adequate for my needs.', 1),
(20, 1, 3, 2, 'i_sq2', 20, '<b>Teaching Support Facilities (optional where applicable):</b> Computing specific resources are adequate for my needs.', 1),
(21, 6, 1024, 2, 'j', 21, '<b>Please share below any constructive comments you have on any aspect of the class, its lecturer(s), or teaching assistant(s) - both your thoughts on strengths and suggestions for improvements are extremely valuable to help faculty members improve the class on its next offering.</b>', 1),
(22, 6, 1024, 3, 'k', 22, '<b>UCL awards prizes for the best teaching in the university each year. Do you feel that any individual member of the teaching team (or the team as a whole) should be nominated for a teaching prize for this module?</b>', 1),
(23, 6, 1024, 3, 'l', 23, '<b>Please explain which aspects of the teaching on this module warrant a teaching prize (please name specific instructor or specify if your comments pertain to the whole team).</b>', 1);

